  const [reports, setReports] = useState([]);

  // Fetch reports from Flask API
  useEffect(() => {
    axios.get('http://localhost:5000/reports')
      .then(res => {
        console.log(res.data);
        setReports(res.data);
      })
      .catch(err => {
        console.error('Error fetching reports:', err);
      });
  }, []);

